import React from "react";
import "./WordList.scss";
import TableRow from "./TableRow";
import InputForWord from "../InputWordListAdd/Input";

let words = [
  { id: "peace", english: "peace", transcription: "[ piːs ]", russian: "мир" },
  {
    id: "friendship",
    english: "friendship",
    transcription: "[ ˈfrendʃɪp ]",
    russian: "дружба",
  },

  { id: "gum", english: "gum", transcription: "[ ɡʌm ]", russian: "жвачка" },
];

function WordList() {
  return (
    <div className="main_table">
      <table className="table">
        <caption className="table-name">Words List</caption>
        <thead>
          <tr>
            <th className="col">
              {" "}
              Word
              <InputForWord />
            </th>
            <th className="col">
              Transcription <InputForWord />
            </th>
            <th className="col">
              Translate <InputForWord />
            </th>
            <th className="col">Actions</th>
          </tr>
        </thead>
        <tbody>
          {words.map((word) => (
            <TableRow
              key={word.id}
              word={word.english}
              transcription={word.transcription}
              translation={word.russian}
            />
          ))}
        </tbody>
      </table>
    </div>
  );
}
export default WordList;
